import React from 'react';
import { styled } from '@mui/system';
import { Button } from '@mui/material'
import { Link } from 'react-router-dom'
import drone from '../../assets/images/drone.jpg'

interface Props {
    title: string;
}

const Root = styled('div')({
    padding: 0,
    margin: 0
})

const NavbarContainer = styled('div') ({
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center'
})

const Logo = styled('h1')({
    margin: '0 0 0 0.45'
})

const LogoA = styled('a')({
    color: 'rgb(28,24,22)',
    listStyle: 'none',
    textTransform: 'uppercase',
    textDecoration: 'none'
})

const LogoNavigation = styled('ul')({
    listStyle: 'none',
    textTransform: 'uppercase',
    textDecoration: 'none',
    display: "flex"
})

const NavA = styled (Link)({
    display: 'block',
    padding: '1em',
    color: 'black'
})
const Main = styled('main')( {
    backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(${drone});`,
    width: '100%',
    height: '100%',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
    position: 'absolute',
})
const MainText = styled('div')({
    textAlign: 'center',
    position: 'relative',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: 'white'
})

export const Home = (props:Props) => {
    return (
        <Root>
            <NavbarContainer>
                <Logo>
                    <LogoA href='#'>Ranger Drones</LogoA>
                </Logo>
                <LogoNavigation>
                    <li>
                        <NavA to='#'>Home</NavA>
                    </li>
                    <li>
                        <NavA to= '/dashboard'>Dashboard</NavA>
                    </li>
                    <li>
                        <NavA to='#'>Learn More</NavA>
                    </li>
                </LogoNavigation>
            </NavbarContainer>
            <Main>
                <MainText>
                    <h1>{props.title}</h1>
                    <p>All your Drones are here.</p>
                    <Button color='primary' variant='contained' component={Link} to='/dashboard'>See the Drones</Button>
                </MainText>
            </Main>
        </Root>

    )
}
